import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home-container">
      <Link to="/chatbot">Chatbot</Link>
      <Link to="/translator">Translator</Link>
      <Link to="/faq">FAQ</Link>
      <Link to="/about">About</Link>
    </div>
  );
};

export default Home;
